/** @format */

import React, { Fragment } from "react";
import { Grid, Box } from "@mui/material";
import Filters from "./components/Filters";
import MatterCards from "./components/MatterCards";

const Matters = () => {
  return (
    <Fragment>
      <Box>
        <Grid container>
          <Grid item xs={12}>
            <Filters />
          </Grid>
          <Grid>
            <MatterCards />
          </Grid>
        </Grid>
      </Box>
    </Fragment>
  );
};

export default Matters;
